const Menu=()=>{
    const classes = useStyles();
    const menuItems = ["About", "Projects","contact"]
    return(
        <List>
        {menuItems.map((text, index) => (
          <ListItem key={text} disablePadding>
            <ListItemButton>

              <ListItemText primary={text} />
            </ListItemButton>
          </ListItem>
        ))}
      </List>
    );


}
export default Menu;
